import React, {use} from 'react';
import VideoItem from './VideoItem';

const VideoList = ({ videos, onDelete, voteUp, voteDown }) => {

  useEffect(() => {
    const sortedVideos = [...videosData].sort((a, b) => b.rating - a.rating); // Sort videos by ratings
    setVideos(sortedVideos);
  }, []);
  return (
    <div className="video-list">
      {videos.map((video) => (
        <VideoItem
          key={video.id}
          video={video}
          voteUp={voteUp}
          voteDown={voteDown}
          onDelete={onDelete} />
      ))}
    </div>
  );
};

export default VideoList;
